    public String KNN(double[] test) {

        double[][] res = new double[getArray().length][2];
        for (int ycounter = 0; ycounter < getArray().length; ycounter++) {
            double sum = 0.0;
            for (int xcounter = 0; xcounter < getArray()[ycounter].length - 1; xcounter++) {
                sum += Math.pow((test[xcounter] - getArray()[ycounter][xcounter]), 2);

            }
            sum = Math.sqrt(sum);
            // System.out.println(sum);
            res[ycounter][0] = sum;
            res[ycounter][1] = getArray()[ycounter][test.length];
        }

        double temp = 0;
        double temp1 = 0;

        for (int i = 0; i < res.length; i++) {
            for (int y = 0; y < res.length; y++) {
                if (res[i][0] < res[y][0]) {
                    temp = res[y][0];
                    res[y][0] = res[i][0];
                    res[i][0] = temp;

                    temp1 = res[y][1];
                    res[y][1] = res[i][1];
                    res[i][1] = temp1;

                }
            }
        }

        double[] finalRes = new double[10];
        for (int i = 0; i < 10; i++) {
            finalRes[i] = res[i][1];
        }

                 //0 ==> DoorKnock
        //1 ==>Train
        //2 ==>water
        int DoorKnockCount = 0;
        int TrainCount = 0;
        int waterCount = 0;

        for (int i = 0; i < finalRes.length; i++) {

            if (res[i][1] == 0) {
                DoorKnockCount++;
            }

            if (res[i][1] == 1) {
                TrainCount++;
            }

            if (res[i][1] == 2) {
                waterCount++;
            }

        }

        double[][] countArray = new double[][]{{0, DoorKnockCount}, {1, TrainCount}, {2, waterCount}};

        double max = countArray[0][1];
        double output = 0;
        for (int i = 0; i < countArray.length; i++) {
            if (max < countArray[i][1]) {
                max = countArray[i][1];
                output = countArray[i][0];
            }
        }

        String StrRes = "";
        if (output == 0) {
            StrRes = "the sound is DoorKnock" + "  " + max;
        }
        if (output == 1) {
            StrRes = "the sound is Train" + "  " + max;
        }
        if (output == 2) {
            StrRes = "the sound is water" + "  " + max;
        }

        return StrRes;

    }

